scriptlet.script:
protocol = scriptletContext.get("protocol");
out = scriptletRawResult['stdOut'];
error = scriptletRawResult['exception'];
result = scriptletRawResult['Result'];
returnCode = scriptletRawResult['returnCode'];
stdErr = scriptletRawResult['stdErr'];
if (returnCode == -1)
{
    if ((error == null) || (error == ""))
    {
        if ((stdErr == "" ) || (stdErr == null))
            error = "Could not get information";
        else  
           error = stdErr;
     }
     scriptletContext.put("Error String", error);
}
else if ((protocol.indexOf("Telnet") != -1) && (error == null))
{
    if (result.toLowerCase().indexOf("not found") != -1)
    {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", out);
     }
     if (result.toLowerCase().indexOf("no such file or directory") != -1)
     {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", out);     
     }
     if (result.toLowerCase().indexOf("cannot execute") != -1)
     {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", out);     
     }
     if (result.toLowerCase().indexOf("usage: ls") != -1)
     {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", out);     
     }
      if (result.toLowerCase().indexOf("permission denied") != -1)
     {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", out);     
     }
      if ((result == null) || (result == ""))
     {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", "Could not get last modified date for the file.");     
     }
}

var locale;
var inputDate;

if (typeof localeLang != 'undefined' && localeLang != null && localeLang.length > 0) {
    if (typeof localeCountry != 'undefined' && localeCountry != null && localeCountry.length > 0) {
        locale = new java.util.Locale(localeLang, localeCountry);
    } else {
        locale = new java.util.Locale(localeLang);
    }
} else {
    locale = java.util.Locale.getDefault();
}

var inputDataS = scriptletInput.split(/\b\s+/);
if (inputDataS != null && inputDataS.length > 5) {
    var inputData = inputDataS[4] + " " + inputDataS[5];
    var inputDateFormatter = new java.text.SimpleDateFormat("y-M-d H:m:s");
    try {
        inputDate = inputDateFormatter.parse(inputData);
    } catch (e) {
    }
}

if (inputDate != null) {
    var outputDateFormatter = java.text.DateFormat.getDateTimeInstance(java.text.DateFormat.LONG, java.text.DateFormat.LONG, locale);
    scriptletResult = outputDateFormatter.format(inputDate);
}

